Issue-body:
When we build the application for release, the browser does not open when we call `signIn`. After doing a lot of digging, it appears to be caused by setting `minifyEnabled` to be true inside the `app build.gradle`'s release build type:

```gradle
buildTypes {
    release {
        minifyEnabled true
        proguardFiles getDefaultProguardFile("proguard-android.txt"), "proguard-rules.pro"
        signingConfig signingConfigs.release
    }
}
```

Simply changing `minifyEnabled` to `false` is a work around, but we'd like to continue minimizing the native code.

This isn't necessarily limited to release builds, it could happen on debug as well if `minifyEnabled` is `true`

